import React from 'react';
import MapContainer from './components/map';
import styled, {css} from 'styled-components'

// function Button(props) {
//   return <button> {props.label} </button>
// }

const Button = styled.button`
  background: transparent;
  border-radius: 3px;
  border: 2px solid red;
  color: red;
  margin: 0 1em;
  padding: 0.25em 1em;

  ${props =>
    props.primary &&
    css`
      background: red;
      color: white;
    `};
`

function changeView(props) {
  this.setState({})
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <h2>
        <Button primary onClick={this.changeView}>North America</Button>
        <Button primary>South America</Button>
        <Button primary>Europe</Button>
        <Button primary>Oceania</Button>
        <Button primary>Antarctica</Button>
        <Button primary>Africa</Button>
      </h2>
      </header>
      <MapContainer />
    </div>
  );
}

export default App;
